import React, { Suspense, useState, useEffect } from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import { Web3Provider } from './contexts/Web3Context';

// Components
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Loading from './components/Loading';
import VideoPlayer from './components/VideoPlayer';

// Lazy load pages for better performance
const Dashboard = React.lazy(() => import('./pages/Dashboard'));
const DocumentGenerator = React.lazy(() => import('./pages/DocumentGenerator'));
const ContractReviewer = React.lazy(() => import('./pages/ContractReviewer'));
const DAOCreator = React.lazy(() => import('./pages/DAOCreator'));
const LegalChatbot = React.lazy(() => import('./pages/LegalChatbot'));
const Home = React.lazy(() => import('./pages/Home'));

function App() {
  const [isMobile, setIsMobile] = useState(false);
  const [showSplash, setShowSplash] = useState(true);

  // Check viewport width to choose between desktop and mobile video
  useEffect(() => {
    const handleResize = () => {
      setIsMobile(window.innerWidth < 768);
    };

    window.addEventListener('resize', handleResize);
    handleResize();

    return () => window.removeEventListener('resize', handleResize);
  }, []);

  // Disable scrolling when splash video is active
  useEffect(() => {
    document.body.style.overflow = showSplash ? 'hidden' : 'auto';
    return () => {
      document.body.style.overflow = 'auto';
    };
  }, [showSplash]);

  // Handle splash video completion
  const handleVideoEnd = () => {
    console.log('Video ended, hiding splash screen');
    setShowSplash(false);
  };

  return (
    <AuthProvider>
      <Web3Provider>
        <div className="flex flex-col min-h-screen relative">
          {/* Splash video overlay */}
          {showSplash && (
            <div className="fixed inset-0 z-50 bg-white">
              <VideoPlayer
                src={isMobile ? '/assets/Load2.mp4' : '/assets/Load.mp4'}
                onEnded={handleVideoEnd}
                className="w-full h-full object-cover"
                autoPlay={true}
                loop={false}
                muted={true}
              />
              <div className="absolute bottom-10 left-0 right-0 text-center">
                <h1 className="text-3xl font-bold text-indigo-600">DigiLex</h1>
                <p className="text-gray-500 mt-2">Loading your legal assistant...</p>
              </div>
            </div>
          )}

          {/* Main content */}
          <Navbar />
          <main className="flex-grow">
            <Suspense fallback={<Loading />}>
              <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/dashboard" element={<Dashboard />} />
                <Route path="/document-generator" element={<DocumentGenerator />} />
                <Route path="/contract-reviewer" element={<ContractReviewer />} />
                <Route path="/dao-creator" element={<DAOCreator />} />
                <Route path="/legal-chatbot" element={<LegalChatbot />} />
                <Route path="*" element={<Navigate to="/" replace />} />
              </Routes>
            </Suspense>
          </main>
          <Footer />
        </div>
      </Web3Provider>
    </AuthProvider>
  );
}

export default App;
